import './FollowingResources.css'
import { useEffect, useState } from "react";
import axios from "axios";

const FollowingResources = ({ userId }) => {
  const [followingPosts, setFollowingPosts] = useState([]);

  useEffect(() => {
    const fetchFollowingPosts = async () => {
      const response = await axios.get(`/api/users/${userId}/following/posts`);
      setFollowingPosts(response.data);
    };

    fetchFollowingPosts();
  }, [userId]);

  return (
    <div>
      <h2>Following Posts</h2>
      {followingPosts.map((post) => (
        <div key={post.id}>
          <img src={post.image} alt={post.title} />
          <h3>{post.title}</h3>
          <p>{post.content}</p>
        </div>
      ))}
    </div>
  );
};
export default FollowingResources
